func threeSum(nums []int) [][]int {
	l := len(nums)
	if l == 0 {
		return nil
	}
	sort.Ints(nums)

	r := make([][]int, 0)
	j := 0
	k := 0
	v := 0
	for i := 0; i < l-2; i++ {
		if nums[i] > 0 {
			break
		}
		if i > 0 && nums[i] == nums[i-1] {
			continue
		}
		j = i + 1
		k = l - 1
		for j < k {
			v = nums[i] + nums[j] + nums[k]
			if v == 0 {
				r = append(r, []int{nums[i], nums[j], nums[k]})
				for {
					j++
					if j >= k || nums[j-1] != nums[j] {
						break
					}
				}
				for {
					k --
					if j >= k || nums[k] != nums[k+1] {
						break
					}
				}
			} else if v > 0 {
				for {
					k --
					if j >= k || nums[k] != nums[k+1] {
						break
					}
				}
			} else {
				for {
					j++
					if j >= k || nums[j-1] != nums[j] {
						break
					}
				}
			}
		}
	}
	return r
}

func _printArrayArray(t [][]int) {
	for _, v := range t {
		_printArray(v)
	}
}
func _printArray(t []int) {
	for _, v := range t {
		print(v, ",")
	}
	println("")
}
